script: |
  super -f text -I q6.spq | sort > q6.out

inputs:
  - name: q6.spq
    data: |
      SELECT 1 * col1 FROM tab2 (FORMAT parquet) WHERE 5 / - 94 + + 86 * + col2 NOT BETWEEN CAST ( col1 AS INTEGER ) * - col1 - + CAST ( NULL AS INTEGER ) AND + col0;
  - name: tab2

outputs:
  - name: q6.out
    data: |
      51
      67
      77
